import React from 'react';

class Stack extends React.Component {
  constructor(props){
    super(props)
  }

  render() {
    return (
      <div className="container container-fluid border-primary">
        <h1>I've Got Some Skills</h1>
        <p>HTML</p>
        <p>CSS</p>
        <p>JavaScript</p>
        <p>jQuery</p>
        <p>Bootstrap</p>
        <p>React.js</p>
      </div>
    );
  }
}

export { Stack }
